import React, { useState } from 'react';  
import styles from '../src/styles/Settings.module.css'; // Importation du CSS en tant que module
import { FaCog, FaTachometerAlt, FaFileInvoiceDollar, FaChartLine, FaSignOutAlt, FaBell } from 'react-icons/fa'; // Importation des ic么nes

const Settings = () => {  
  const [userName, setUserName] = useState('');  
  const [email, setEmail] = useState('');  
  const [password, setPassword] = useState('');  
  const [confirmPassword, setConfirmPassword] = useState('');  
  const [threshold, setThreshold] = useState('');  
  const [pricePerKw, setPricePerKw] = useState('');  

  const handleSubmit = (e) => {  
    e.preventDefault();  
    // G茅rer la soumission du formulaire (ex: envoyer les donn茅es au backend)
    console.log({ userName, email, password, threshold, pricePerKw });
  };  

  return (  
    <div className={styles.settingsContainer}>  
      <Sidebar />  
      <div className={styles.settingsContainer}>  
        <div className={styles.header}>  
          <h2>Settings</h2>
          <div className={styles.notification}>
            <FaBell className={styles.notificationIcon} /> {/* Ic么ne de notification */}
          </div>  
        </div>  
        <hr />  
        <form onSubmit={handleSubmit}>  
          <div className={styles.profileSection}>  
            <div className={styles.profileImage}>  
               {/* Ic么ne repr茅sentant l'utilisateur */}  
            </div>  
            <div className={styles.inputGroup}>  
              <input  
                type="text"  
                placeholder="User Name"  
                value={userName}  
                onChange={(e) => setUserName(e.target.value)}  
                required  
              />  
              <input  
                type="email"  
                placeholder="Email"  
                value={email}  
                onChange={(e) => setEmail(e.target.value)}  
                required  
              />  
              <input  
                type="password"  
                placeholder="Password"  
                value={password}  
                onChange={(e) => setPassword(e.target.value)}  
                required  
              />  
              <input  
                type="password"  
                placeholder="Confirm Password"  
                value={confirmPassword}  
                onChange={(e) => setConfirmPassword(e.target.value)}  
                required  
              />  
            </div>  
          </div>  

          <div className={styles.settingsSection}>  
            <input  
              type="number"  
              placeholder="Threshold in kW"  
              value={threshold}  
              onChange={(e) => setThreshold(e.target.value)}  
              required  
            />  
            <input  
              type="number"  
              placeholder="Price of 1 kW"  
              value={pricePerKw}  
              onChange={(e) => setPricePerKw(e.target.value)}  
              required  
            />  
          </div>  

          <button type="submit">Save Changes</button>  
        </form>  
      </div>  
    </div>  
  );  
};  

const Sidebar = () => (  
  <nav className={styles.settingsSidebar}>  
    <ul>  
      <li><a href="/dashboard"><FaTachometerAlt /> Dashboard</a></li>  
      <li><a href="/consumption"><FaChartLine /> Consumption</a></li>  
      <li><a href="/billing"><FaFileInvoiceDollar /> Billing</a></li>  
      <li><a href="/settings"><FaCog /> Settings</a></li>   
      <li><a href="/login"><FaSignOutAlt /> Sign Out</a></li>  
    </ul>  
  </nav>  
);  

export default Settings;
